import React, { Component } from 'react';
import NavBar from '../components/NavBar';
import 'bulma/css/bulma.css';
import WebFont from 'webfontloader'

WebFont.load({
    google: {
        families: ['Karla']
    }
});

const styles = {
    background: {
        position: 'absolute',
        justifyContent: 'center'
    },
    title: {
        fontFamily: 'Karla',
        fontSize: '50px',
        fontWeight: '400',
        position: 'relative',
        color: 'white',
        marginTop: '35%',
        marginLeft: '12%'
    },
    slogan: {
        fontFamily: 'Karla',
        fontSize: '25px',
        position: 'relative',
        color: 'white',
        marginLeft: '12%'
    }
}

class HomePage extends Component {
    render() {
        return (
        <React.Fragment>
            <div><NavBar/></div>
            <img src={ process.env.PUBLIC_URL + '/main-background2.jpg'} style={ styles.background }/>
            <div style={ styles.title }>Job Keeper</div>
            <div style= {styles.slogan }>Keep track of you jobs</div>
        </React.Fragment>
        );
    }
}

export default HomePage;
